import React from 'react'
import '../Internal.css'

const Projects = () => {
    return (
        <div className='classic-text'>
            <h1 className='wacky-line'>
                <span>P</span>
                <span>R</span>
                <span>O</span>
                <span>J</span>
                <span>E</span>
                <span>C</span>
                <span>T</span>
                <span>S</span>
                <span>!</span>
            </h1>
            <p>
                Projects text goes here
            </p>
        </div>
    );
};

export default Projects;
